// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract ZNft is ERC721Enumerable, Ownable {
    using Strings for uint256;

    // Configurable constants
    uint256 public constant MAX_SUPPLY = 100;
    uint256 public constant PRICE = 0.123 ether;

    // See also: constructor() where token name and symbol is defined
    // --- end configurable constants

    // Profit sharing addresses (see withdraw() for more details)
    address private _devAddress1 = 0xd3bE9b0efa08eC7Fb13F98d36354ffA3aFa9BB91;

    // Base URI for generating token metadata URL
    // If this was https://example.com/ token id 5 would generate https://example.com/5
    string public BASE_URI;

    // Addresses that are allowed to mint
    // All addresses are allowed to mint if public minting is turned on
    mapping(address => bool) public minters;

    // If this is true, no one is allowed to mint
    bool public mintingPaused = false;

    // If this is true, anyone is allowed to mint
    // If this is false, only approved minters are allowed to mint
    bool public allowPublicMint = false;

    constructor() ERC721("Z NFT Template v1", "ZNFT1") {}

    // Pause minting for all addresses
    function setMintingPaused(bool isPaused) external onlyOwner {
        mintingPaused = isPaused;
    }

    // Allow anyone to mint
    function setAllowPublicMint(bool isAllowed) external onlyOwner {
        allowPublicMint = isAllowed;
    }

    function addToMinters(address[] calldata addrs) external onlyOwner {
        for(uint256 i = 0; i < addrs.length; i++) {
            address addr = addrs[i];
            require(addr != address(0), "ERR_NULL_ADDRESS");

            minters[addr] = true;
        }
    }

    function isMinter(address addr) external view returns (bool) {
        return minters[addr];
    }

    function mint() external payable {
        require(!mintingPaused, "ERR_MINTING_PAUSED");
        require(minters[msg.sender] || allowPublicMint, "ERR_NOT_MINTER");

        // msg.value is price paid
        require(msg.value >= PRICE);

        uint256 mintId = totalSupply() + 1;
        require(mintId <= MAX_SUPPLY);

        _safeMint(msg.sender, mintId);
    }

    function tokenURI(uint256 tokenId) public view override(ERC721) returns (string memory) {
        require(_exists(tokenId), "ERR_INVALID_TOKEN_ID");

        return string(abi.encodePacked(BASE_URI, tokenId.toString()));
    }

    function setBaseURI(string memory uri) public onlyOwner {
        BASE_URI = uri;
    }

    function withdraw() external onlyOwner {
        // 2% fee to _devAddress1
        payable(_devAddress1).transfer(address(this).balance * 2 / 100);

        // Remaining balance to contract owner
        payable(msg.sender).transfer(address(this).balance);
    }
}
